def vowels_count(s):
    vowels = {'a', 'e', 'i', 'o', 'u'}
    count = 0
    for i, char in enumerate(s.lower()):
        if char in vowels:
            count += 1
        elif char == 'y' and i == len(s) - 1:
            count += 1
    return count

def pluck(arr):
    min_even = None
    min_index = -1
    for i, num in enumerate(arr):
        if num % 2 == 0:
            if min_even is None or num < min_even or (num == min_even and i < min_index):
                min_even = num
                min_index = i
    if min_even is not None:
        return [min_even, min_index]
    return []

def search(lst):
    from collections import Counter
    counts = Counter(lst)
    max_val = -1
    for num, freq in counts.items():
        if freq >= num and num > max_val:
            max_val = num
    return max_val

def triangle_area(a, b, c):
    if a + b > c and a + c > b and b + c > a:
        s = (a + b + c) / 2
        area = (s * (s - a) * (s - b) * (s - c)) ** 0.5
        return round(area, 2)
    return -1

def smallest_change(arr):
    n = len(arr)
    changes = 0
    for i in range(n // 2):
        if arr[i] != arr[n - 1 - i]:
            changes += 1
    return changes

def is_multiply_prime(a):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    primes = [i for i in range(2, a) if is_prime(i)]
    for i in primes:
        for j in primes:
            if i * j > a:
                break
            for k in primes:
                if i * j * k == a:
                    return True
    return False

def is_simple_power(x, n):
    if n == 1:
        return x == 1
    if x == 1:
        return True
    power = n
    while power < x:
        power *= n
    return power == x

def iscube(a):
    if isinstance(a, complex):
        return False
    try:
        root = a ** (1/3)
        return round(root) ** 3 == a or round(root - 1e-9) ** 3 == a
    except:
        return False

def hex_key(num):
    prime_digits = {'2', '3', '5', '7', 'B', 'D'}
    count = 0
    for digit in num:
        if digit in prime_digits:
            count += 1
    return count

def decimal_to_binary(decimal):
    binary = bin(decimal)[2:]
    return f"db{binary}db"
